import React from "react";
import { useParams } from "react-router-dom";

const DayPage = () => {
    const {day} = useParams()
    const time = []
    for (let index = 0; index < 24; index+=1) {
        for (let i = 0; i < 60; i+=15) {
            if (index < 10 ) {
                if (i === 0) {
                    time.push(`0${index}:0${i}`)    
                }
                else {
                    time.push(`0${index}:${i}`)
                }
            } 
            if (i === 0 && index > 10) {
                time.push(`${index}:0${i}`)
            }
            else {
                time.push(`${index}:${i}`)
            }
        }
    }
    console.log(time);
    return(
        <>
            {day}
        </>
    )
}

export default DayPage
